[metadata]
name = MLapp1
version = 0.0.18
author = Akshay
author_email = akshaysuhag1996@gmail.com
description = "MLapp"
long_description = file: README.md
long_description_content_type = text/markdown
url = https://github.com/FunctionalUrology/
project_urls = 
	Bug Tracker = https://github.com/FunctionalUrology/
classifiers = 
	Programming Language :: Python :: 3
	License :: OSI Approved :: MIT License
	Operating System :: OS Independent

[options.package_data]
* = *.csv, *.txt

[options]
package_dir = 
	= src
packages = find:
python_requires = >=3.9
install_requires = 
	dash==2.5.1
	dash_bootstrap_components==0.13.0
	dash_table==5.0.0
	subprocess.run==0.0.8
	pickle4==0.0.1
	numpy==1.21.2
	zipfile36==0.1.3
	pandas==1.3.3
	scikit-learn==1.0.2
	collections2==0.3.0
	colorlover==0.3.0
	plotly==5.10.0
	bokeh==2.4.3
	imbalanced-learn==0.9.0
	matplotlib==3.4.3
	dash-loading-spinners==1.0.0

[options.packages.find]
where = src

[egg_info]
tag_build = 
tag_date = 0

